(84, 'Oracle Fusion SCM 56th Batch', 'Oracle Fusion SCM Training with End to End configurations along with real time examples.', '<p>Supply chain management (SCM) is the backbone of countless industries and businesses, facilitating the flow of goods and services from raw materials to the hands of the end consumer. It\'s a complex and critical process that ensures products reach their intended destination efficiently and cost-effectively. This course is designed meet all the individuals to perform implementation after completion of the course.<br></p>', '[\"SCM Project Implementation\",\"SCM Project Support\"]', 'english', 5, 6, '[269,273]', '[\"No Pre requisites to learn this course\",\"No coding knowledge required\"]', 25000, NULL, 0, 'advanced', '1,10', NULL, '', 1699228800, 1706180558, 'general', 1, 1, 1, 1, 'active', '', '', '', NULL, 1, 0, 1, '[]', '12', NULL, 'oracle-fusion-scm-56th-batch', 'oracle', 'oracle-fusion', '', '', '', 0, 3),
(85, 'Oracle Fusion Financials 60th Batch', '', '', '[]', 'english', 5, 6, '[272]', '[]', 25000, NULL, 0, 'advanced', '1', NULL, '', 1700524800, 1700810216, 'general', 0, 0, 0, 1, 'active', '', '', '', NULL, 0, 0, 1, '[]', '12', NULL, 'oracle-fusion-financials-60th-batch', 'oracle', 'oracle-fusion', NULL, NULL, NULL, NULL, NULL),
(87, 'Oracle EBS R12 SCM Training', 'Oracle R12 SCM (Supply Chain Management) is an industry-leading solution in the Oracle R12 ERP family. It allows companies to build World-class Value-chains for maximum growth. Oracle R12 Apps SCM integrates and automates all supply chain processes from Designing, Planning and Procurement to Manufacturing and fulfillment to give a complete set of solutions. It has a Unified data model with the best-driven principles, accurate view of each Supply chain.', '<p xss=\"removed\">Oracle R12 SCM (Supply Chain Management) is an industry-leading solution in the Oracle R12 ERP family. It allows companies to build World-class Value-chains for maximum growth. Oracle R12 Apps SCM integrates and automates all supply chain processes from Designing, Planning and Procurement to Manufacturing and fulfillment to give a complete set of solutions.  It has a Unified data model with the best-driven principles, accurate view of each Supply chain.</p><p xss=\"removed\"><br></p><p xss=\"removed\">Companies have better chances to implement lean demand-driven strategies and manage their Supply chains to save time with maximizing ROI. It automatically allows creating real-time strategies for increasing demand based on real-time information. Oracle R12 E-Business suite SCM Application is implemented in Airlines, Automotive, Communications, Consumer Goods, High Technology, Industrial Manufacturing, Life Sciences, and Public Sector.</p><p xss=\"removed\"><br></p><h2 xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">Online Oracle EBS R12 SCM Training</span></span></h2><p xss=\"removed\">Online Oracle EBS R12 SCM training gives you a virtual classroom learning experience. We use cloud Video Meeting Applications for seamless learning. Each session has a good scope for trainees to clear their doubts.  These course timings are finalized as per your requirement. Online Training will be time-saving and the best option to learn at your place.</p><p xss=\"removed\"><br></p><h2 xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">Corporate Training For Oracle R12 SCM Application</span></span></h2><p xss=\"removed\">Tech Leads IT has a great reputation for organizing bulk or Corporate Training sessions. There are many companies who use our services to improve their employee’s skills and worth. In our training session, we not only improve skills but also make them work with high productivity.</p><p xss=\"removed\"><br></p><h2 xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\">Oracle R12 SCM Classroom Training</span></span></h2><p xss=\"removed\">To learn Oracle R12 SCM Application with live demonstrations and hands-on experience attend classroom training. Learn along with teammates to improve your knowledge with discussions and sharing. At our institute, we have a fully equipped classroom and lab facility for daily practice.</p>', '[]', 'english', 5, 7, '[]', '[]', 0, NULL, 0, 'advanced', '1,10', NULL, 'https://www.youtube.com/watch?v=ZQo7RryS6G0', 1701666000, 1704973953, 'general', 0, 0, 1, 1, 'active', 'youtube', '', 'Enhance your skills with oracle EBS scm training provided by techleads it.', NULL, 1, 0, 1, '{\"What are the pre-requisites to learn this course?\":\"Absolutely there are no pre-requisites to learn this course, there is no need of SQL, Java and C Language. Just basic business knowledge like what is customer, supplier, invoice, sales order and purchase order this knowledge is enough to take the course.\",\"Who are eligible to learn this course?\":\"Not required, we will teach you from the basics. If you\\u2018ve EBS knowledge that is added advantage.\",\"Does Oracle EBS knowledge required to attend this training?\":\"Not required, we will teach you from the basics. If you\\u2018ve EBS knowledge that is added advantage.\",\"How many members approximately for a batch?\":\"Around 10-15 members in each batch. We make sure very student understand and align with us during the classes.\",\"Can I take a pause\\/break in the middle and continue in the next batch?\":\"Course validity for one year. You can take a break and re-join in any of the upcoming batches with in in 1 year.\",\"How did you help in getting the job?\":\"We have tie-up with many companies and companies are also coming to our premises to recruit of our students, we have campus placements within the institute.\",\"What if I don\'t satisfy with teaching?\":\"We so sorry to hear this from you. All our faculties are real time trainers but even though if something is not meeting your expectations, we are ready to return your full amount.\",\"Do you help in providing samples resumes and preparation?\":\"Yes, we will provide you sample resumes and guide you in preparation of Project roles and responsibilities.\"}', NULL, '1701682517.pdf', 'oracle-r12-scm-online-training-course', 'oracle', 'oracle-ebs', '70', '1', '1', 0, 2),
